import { Component } from 'react'
import Link from 'next/link'



class Header extends Component {
  constructor() {
    super()
  }

  render(h) {
    return (
      <div className={'nav-bar'}>
          <div className={'row'}>
              <div className={'column'}>sads</div>
              <div className={'column'}>asdas</div>
          </div>
      </div>
    );
  }
}

export default Header;
